import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/logo.png'; // Make sure this file exists
import ContactForm from './ContactForm'; // Popup form component

function Navbar() {
  const [showForm, setShowForm] = useState(false);

  return (
    <>
      <nav className='navbar'>
        <div className='logo'>
          {/* Logo image */}
          <img
            src={logo}
            alt='Logo'
            style={{ width: '150px', height: 'auto' }}
            onError={(e) => {
              e.target.src = 'https://via.placeholder.com/200x80.png?text=Logo'; // fallback if logo.png is missing
            }}
          />
        </div>

        {/* Navigation links */}
        <ul className='nav-links'>
          <li><Link to='/'>Home</Link></li>
          <li><Link to='/product'>Product</Link></li>
          <li>
            <button
              onClick={() => setShowForm(true)}
              style={{
                padding: '6px 12px',
                border: 'none',
                borderRadius: '5px',
                background: '#28a745',
                color: '#fff',
                cursor: 'pointer'
              }}
            >
              Contact Us
            </button>
          </li>
        </ul>
      </nav>

      {/* Contact popup */}
      {showForm && <ContactForm closeForm={() => setShowForm(false)} />}
    </>
  );
}

export default Navbar;
